import React from '../../Frontend/node_modules/react';
import { NextPage } from 'next'
import ReactDOM from '../../Frontend/node_modules/react-dom';
import { BrowserRouter, Route, Switch, Redirect } from "../../Frontend/node_modules/react-router-dom";
import Login from '../../Frontend/src/views/Login';
import Dashboard from '../../Frontend/src/views/Dashboard';
import '../../Frontend/src/styles/imports.scss';



const App = () =>{
	return(
		<BrowserRouter>
		    <Switch>
			    <Route path="/login" render={props => <Login {...props} />} />
			    <Route path="/dashboard" render={props => <Dashboard {...props} />} />
			    <Redirect path="/" to="/login"></Redirect>
		    </Switch>
		 </BrowserRouter>
		)
}

export default App;
